export default () => {
  return (
    <ProConfigProvider
      valueTypeMap={{
        link: {
          render: (text) => <a>{text}</a>,
          renderFormItem: (text, props) => (
            <Input placeholder="\u8BF7\u8F93\u5165\u94FE\u63A5" {...props?.fieldProps} />
          ),
        },
        tags: {
          render: (text) => {
            return (
              <>
                {[text].flat(1).map((item) => (
                  <Tag key={item.value}>{item.label}</Tag>
                ))}
              </>
            );
          },
          renderFormItem: (text, props) => (
            <TagList {...props} {...props?.fieldProps} />
          ),
        },
      }}
      hashed={false}
    >
      <ProCard
        title="SchemaForm"
        bordered
        style={{
          marginBlockEnd: 24,
        }}
      >
        <BetaSchemaForm<TableListItem, 'link' | 'tags'>
          initialValues={initialValue}
          columns={columns}
          title="\u81EA\u5B9A\u4E49 valueType"
        />
      </ProCard>
      <ProCard
        title="ProTable"
        bordered
        style={{
          marginBlockEnd: 24,
        }}
      >
        <ProTable
          columns={tableColumns}
          pagination={false}
          toolBarRender={false}
          dataSource={[initialValue]}
        />
      </ProCard>
      <ProCard
        title="ProDescriptions"
        bordered
        style={{
          marginBlockEnd: 24,
        }}
      >
        <ProDescriptions columns={tableColumns} dataSource={initialValue} />
      </ProCard>
    </ProConfigProvider>
  );
};
